import { Grid, Paper, Box, Typography } from "@material-ui/core";

const about = ()=>{
    return(<div>

        <Grid container justify='center' className="a1">
        <Grid container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6} className="a2">
          <Grid item>
            <Box className='a3'>
            <Typography  variant="h1" className='a4'>One-to-one online tuitions from home</Typography>
            </Box>
          </Grid>
          <Grid item>
            <Box className='a5'>
            <Typography className='a6' variant="body1" >Keep your child’s studies on track with interactive online tuition</Typography>
            </Box>
          </Grid>
        </Grid>
        <Grid  container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6} className='a7'>
          <Paper >World</Paper>
        </Grid>
        </Grid>
     <style global jsx>{`
     .a1{
      margin-top: 0;
      margin-left: 0;
      margin-rigth: 0;
     }
     .a2{
      min-height: 65vh;
      padding-left: 48px;
      padding-right: 8px;
      background-color: #181357;
     }
     .a3{

     }
     .a4{
        color: #eb59ae;
     }

     .a5{
       margin-top:16px
     }

     .a6{
       color:#FFFFFF;
     }

     .a7{
      min-height: 65vh;
      background-color: #fafafa;
     }
     @media (min-width: 992px)
     {
     .a4 {
         font-size: 4.125rem !important;
         font-weight: 900 !important;
         line-height: 4.75rem !important;
     }
     .a6{
        font-size: 1.75rem !important;
        font-weight: 500 !important;
        line-height: 2.5rem !important;
    }   
  }
     @media (min-width: 0px){
                .a3{
                  text-align: center;
                }
                .a5{
                  text-align: center;
                }
              }
    @media (min-width: 480px){
              .a3 {
                text-align: center;
                  }
              .a5 {
                text-align: center;
                  }    
                }
   
    @media (min-width: 576px){
              .a3 {
                  text-align: left;
                  }
              .a5 {
                  text-align: left;
                  }
                }
    @media (min-width: 768px){
                .MuiGrid-grid-lg-6 {
                  flex-grow: 0;
                  max-width: 50%;
                  flex-basis: 50%;
              }
    }
   
     `}</style>
    </div>)
}

export default about;
